    <h2 http-equiv="content-type" content="text/html; charset=utf-8" style="text-align: left; margin-bottom: 0; color: rgb(0, 0, 0); border-bottom-width: 0px; font-size: 18px; white-space: normal; border-top-style: none; padding-top: 0px; border-right-style: none; line-height: 1.3; word-spacing: 0px; text-transform: none; background-position: initial initial; border-left-style: none; background-color: rgb(255, 255, 255); margin-left: 0px; text-indent: 0px; border-left-width: 0px; margin-top: 0px; vertical-align: baseline; background-repeat: repeat; padding-bottom: 0px; border-right-width: 0px; padding-right: 0px; letter-spacing: normal; padding-left: 0px; font-variant: normal; border-bottom-style: none; margin-right: 0px; font-family: Trebuchet MS, Liberation Sans, DejaVu Sans, sans-serif; font-weight: bold; font-style: normal; border-top-width: 0px">
      <a style="margin-bottom: 0px; color: rgb(74, 107, 130); border-bottom-width: 0px; font-size: 18px; border-top-style: none; padding-top: 0px; border-right-style: none; background-position: initial initial; border-left-style: none; margin-left: 0px; border-left-width: 0px; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; background-repeat: repeat; border-right-width: 0px; padding-right: 0px; padding-left: 0px; border-bottom-style: none; text-decoration: none; margin-right: 0px; border-top-width: 0px" href="http://en.wikipedia.org/wiki/Creational_pattern"><font size="18px" color="rgb(74, 107, 130)">Creational patterns</font></a>
    </h2>
    <h3 style="text-align: left; margin-bottom: 0; color: rgb(0, 0, 0); border-bottom-width: 0px; font-size: 14px; white-space: normal; border-top-style: none; padding-top: 0px; border-right-style: none; line-height: 1.3; word-spacing: 0px; text-transform: none; background-position: initial initial; border-left-style: none; background-color: rgb(255, 255, 255); margin-left: 0px; text-indent: 0px; border-left-width: 0px; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; background-repeat: repeat; border-right-width: 0px; padding-right: 0px; letter-spacing: normal; padding-left: 0px; font-variant: normal; border-bottom-style: none; margin-right: 0px; font-family: Trebuchet MS, Liberation Sans, DejaVu Sans, sans-serif; font-weight: bold; font-style: normal; border-top-width: 0px">
