    <ul style="text-align: left; margin-bottom: 0; color: rgb(0, 0, 0); border-bottom-width: 0px; font-size: 13px; white-space: normal; border-top-style: none; padding-top: 0px; border-right-style: none; line-height: 16px; word-spacing: 0px; text-transform: none; background-position: initial initial; border-left-style: none; list-style: disc; background-color: rgb(255, 255, 255); margin-left: 30px; text-indent: 0px; border-left-width: 0px; margin-top: 0px; vertical-align: baseline; background-repeat: repeat; padding-bottom: 0px; border-right-width: 0px; padding-right: 0px; letter-spacing: normal; padding-left: 0px; font-variant: normal; border-bottom-style: none; margin-right: 0px; font-family: Arial, Liberation Sans, DejaVu Sans, sans-serif; font-weight: normal; font-style: normal; border-top-width: 0px">
