      <a href="http://en.wikipedia.org/wiki/Visitor_pattern" style="margin-bottom: 0px; color: rgb(74, 107, 130); border-bottom-width: 0px; font-size: 14px; border-top-style: none; padding-top: 0px; border-right-style: none; background-position: initial initial; border-left-style: none; margin-left: 0px; border-left-width: 0px; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; background-repeat: repeat; border-right-width: 0px; padding-right: 0px; padding-left: 0px; border-bottom-style: none; text-decoration: none; margin-right: 0px; border-top-width: 0px"><font color="rgb(74, 107, 130)" size="14px">Visitor</font></a><span class="Apple-converted-space">&#160;</span><sup style="margin-bottom: 0px; border-bottom-width: 0px; font-size: 11px; border-top-style: none; padding-top: 0px; border-right-style: none; background-position: initial initial; border-left-style: none; margin-left: 0px; border-left-width: 0px; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; background-repeat: repeat; border-right-width: 0px; padding-right: 0px; padding-left: 0px; border-bottom-style: none; margin-right: 0px; border-top-width: 0px"><sub style="margin-bottom: 0px; border-bottom-width: 0px; font-size: 9px; border-top-style: none; padding-top: 0px; border-right-style: none; background-position: initial initial; border-left-style: none; margin-left: 0px; border-left-width: 0px; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; background-repeat: repeat; border-right-width: 0px; padding-right: 0px; padding-left: 0px; border-bottom-style: none; margin-right: 0px; border-top-width: 0px"><font size="9px">(recognizeable by two<span class="Apple-converted-space">&#160;</span><i><em style="margin-bottom: 0px; border-bottom-width: 0px; font-size: 9px; border-top-style: none; padding-top: 0px; border-right-style: none; background-position: initial initial; border-left-style: none; margin-left: 0px; border-left-width: 0px; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; background-repeat: repeat; border-right-width: 0px; padding-right: 0px; padding-left: 0px; border-bottom-style: none; margin-right: 0px; font-style: italic; border-top-width: 0px">different</em></i><span class="Apple-converted-space">&#160;</span>abstract/interface types which has methods definied which takes each the<span class="Apple-converted-space">&#160;</span><i><em style="margin-bottom: 0px; border-bottom-width: 0px; font-size: 9px; border-top-style: none; padding-top: 0px; border-right-style: none; background-position: initial initial; border-left-style: none; margin-left: 0px; border-left-width: 0px; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; background-repeat: repeat; border-right-width: 0px; padding-right: 0px; padding-left: 0px; border-bottom-style: none; margin-right: 0px; font-style: italic; border-top-width: 0px">other</em></i>abstract/interface type; the one actually calls the method of the other and the other executes the desired strategy on it)</font></sub></sup>
    </h3>
  </body>
</html>
